import { Suspense } from "react";
import App from "./App"

const GetApp=()=>{
   setTimeout(() => {
    var promise = new Promise( (resolve, reject) => {

        let name = 'Paul'

        if (name === 'Paul') {
           resolve("Promise resolved successfully");
        }
        else {
           reject(Error("Promise rejected"));
        }
     });
     return promise;
   }, 1000);
}
const Test=()=>{
    const e=GetApp();
    return <App />
}
const Major=()=>{
    return <Suspense fallback={<h1>Loading</h1>}>
       <GetApp />
    </Suspense>
}

export default Major;
